            alt="rain"
          />
        </a>
        <a className="anchors" href="/Ghibli">
          <img
            className="mini-gif-2"
            src={require("../gifs/2.gif")}
            alt="rain"
          />
        </a>
        <a className="anchors" href="/Classical">
          <img
            className="mini-gif-3"
            src={require("../gifs/3.gif")}
            alt="rain"
          />
        </a> */
      //   </div>
    );
  }
}

export default MiniMenu;
